SET NAMES utf8;
SET time_zone = '+00:00';
SET foreign_key_checks = 0;
SET sql_mode = 'NO_AUTO_VALUE_ON_ZERO';

SET NAMES utf8mb4;

CREATE DATABASE elektrum;

USE elektrum;

DROP TABLE IF EXISTS `DATA_E`;
CREATE TABLE `DATA_E` (
  `DATA_TIME` timestamp NOT NULL,
  `METER_ID` decimal(18,0) NOT NULL,
  `SAVEDB_TIME` timestamp NULL DEFAULT NULL,
  `KWH_IMPORT` decimal(12,0) DEFAULT NULL,
  `KWH_EXPORT` decimal(12,0) DEFAULT NULL,
  `MDM_Status` varchar(50) DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;



